def choose_attribute(records, attribute, all_attributes):
    # if 'trunk size' not in all_attributes:
    #     print("records",records)

    #print(all_attributes)
    total = len(records)
    results = {}
    for next_attr in all_attributes:
        #print("next_attribute", next_attr)

        ginis = []
        for subtype in attribute[next_attr]:

            #print("subtype",subtype)
            count_type = 0

            count_type_with_success= 0
            count_type_with_flop = 0
            for k, v in records.items():
                if v[next_attr] == subtype:
                    count_type = count_type + 1
                    if v['outcome'] == 'Success':
                        count_type_with_success = count_type_with_success + 1
                    if v['outcome'] == 'Flop':
                        count_type_with_flop = count_type_with_flop + 1
            #print(records)
            if count_type != 0:
                # print("reachedtop", total)
                # print("st, count", subtype, count_type)
                #print("total",total)
                #print("values", count_type, count_type_with_acc, count_type_with_unacc, count_type_with_good, count_type_with_vgood)

                gini_type = (count_type/total)*(1- (count_type_with_success/count_type)*(count_type_with_success/count_type) - (count_type_with_flop/count_type)*(count_type_with_flop/count_type))

            else:
                #print("reached here")
                gini_type = 0
                #print(subtype, gini_type)


            ginis.append(gini_type)
       # print("ginis", ginis)
        sum = 0
        for item in ginis:
            sum = sum + item


        results[sum] = next_attr


    #print("results",results)

    gini = min(results.keys())

    return results[gini]




def parse(attribute_order):
    #    attribute_order = {0: 'director_name', 1: 'actor_2_name', 2: 'genres', 3: 'actor_1_name', 4: 'outcome'}

    records = {}
    with open('out', 'r') as csvfile:
        spamreader = csv.reader(csvfile)
        i = 0
        for row in spamreader:
            j = 0
            temp = {}
            for attribute in row:
                temp[attribute_order[j]] = attribute
                j = j + 1
            records[i] = temp
            i = i + 1
    csvfile.close()
    return records


