def check_same_class(records):
    #print("this error record",records)
    count = 0
    #
    # print()
    for something in records.values():
        if something['outcome'] == records[0]['outcome']:
            count = count +1
    if count == len(records):

        return True
    else:

        return False


def what_class(records):
    #print(records)
    return records[0]['outcome']

def select_records(subtype, records, parent):
    #print(subtype)
    temp = {}
    count = 0
    for something in records.values():

        if something[parent] == subtype:



            temp[count] = something
            count = count + 1

    return temp

